import Head from 'next/head';
import NavBar from './components/navbar';

const Layout = props => {
    return(
        <div>
            <Head>
                <title>Greek Tv</title>
                <link rel="stylesheet" href="/css/bootstrap.min.css" />
            </Head>
            <NavBar />
            <h1>Channels</h1>
            {props.children}    
        </div>
    )
}

export default Layout;
